import React from 'react'
import styled from 'styled-components'

function Card(){
    return(
        <Container>
        <Image>
    <img src='https://hips.hearstapps.com/vader-prod.s3.amazonaws.com/1563378212-amazon-echo-dot-3-1563376152.jpg?crop=1xw:1xh;center,top&resize=768:*' alt=''/>
        </Image>
        <Description></Description>
        </Container>
    )
}

const Container= styled.div`
width: 100%;
height: 100%;
display:flex;
flex-direction:column;
background-color: #fff;
z-index:10;
border: 1px solid red;

`;

const Image=styled.div`
width: 100%;
display:flex;
flex-direction: column;
img{
    width:180px;
    height:200px;
}
`;
const Description= styled.div``;

export default Card
